import React, { useEffect, useState, useContext } from "react";
import $ from "jquery";
import { Link } from "react-router-dom";
import MuiAlert from '@material-ui/lab/Alert';
import { makeStyles } from "@material-ui/core/styles";
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import CancelIcon from '@material-ui/icons/Cancel';
import Backdrop from '@material-ui/core/Backdrop';
import CircularProgress from '@material-ui/core/CircularProgress';
import Snackbar from '@material-ui/core/Snackbar';
import Skeleton from '@material-ui/lab/Skeleton';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import video from "../../images/video.mp4";
import Footer from "../../components/Footer/Footer";
import logo from "../../images/vtc-logo.png";
import mission_bg from "../../images/mission-bg.jpg";
import phone from "../../images/phone.png";
import ftr_head from "../../images/ftr-head-bg.png";
import pic_bg from "../../images/pic-bg.png";
import video_1 from "../../images/video3.mp4";
import user from "../../images/user.jpg";
import { APIURL, APIPath } from "../../CommonMethods/Fetch";
import { postRecord } from "../../CommonMethods/Save";
import { AuthContext } from "../../CommonMethods/Authentication";
import Footer1 from "../../components/Footer/Footer1";
const APIGetSiteSetting = APIURL() + "sitesetting";
const APIGetUserData = APIURL() + "user-details";
const APIHomeData = APIURL() + "homecontent";
const APIPartnerData = APIURL() + "company-logoList";
const APIGetBrokerDetails = APIURL() + "get-BrokerDetails";
const APIVisitorOption = APIURL() + "visitor-opt-newsletter";

function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const options = {
    lazyLoad: true,
    loop: true,
    margin: 0,
    responsiveClass: true,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    autoplay: true,
    autoplayTimeout: 3500,
    autoplayHoverPause: false,
    autoHeight: true,
    mouseDrag: true,
    touchDrag: true,
    smartSpeed: 1000,
    nav: true,
    navText: ["<i class='fa fa-angle-left sp'></i>", "<i class='fa fa-angle-right sp'></i>"],
    dots: false,
    responsive: {
        0: {
            items: 1
        },

        600: {
            items: 1
        },

        1024: {
            items: 1
        },

        1366: {
            items: 1
        }
    }
};
const options1 = {
    lazyLoad: true,
    loop: true,
    margin: 20,
    responsiveClass: true,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    autoplay: true,
    autoplayTimeout: 3500,
    autoplayHoverPause: false,
    autoHeight: true,
    mouseDrag: true,
    touchDrag: true,
    smartSpeed: 2500,
    nav: false,
    dots: false,
    responsive: {
        0: {
            items: 1
        },

        600: {
            items: 2
        },

        1024: {
            items: 4
        },

        1366: {
            items: 5
        }
    }
};
const options2 = {
    lazyLoad: true,
    loop: true,
    margin: 20,
    responsiveClass: true,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    autoplay: true,
    autoplayTimeout: 3500,
    autoplayHoverPause: false,
    autoHeight: true,
    mouseDrag: true,
    touchDrag: true,
    smartSpeed: 2500,
    nav: false,
    dots: true,
    responsive: {
        0: {
            items: 1
        },

        600: {
            items: 1
        },

        1024: {
            items: 1
        },

        1366: {
            items: 1
        }
    }
};
const useStyles = makeStyles((theme) => ({
    recent_projects_head: {
        position: "relative",
        textAlign: "center",
        '& h2::after': {
            backgroundImage: "url(" + ftr_head + ")",
            content: '""',
            height: "4px",
            width: "50px",
            position: "absolute",
            textAlign: "center",
            right: "0",
            left: "0",
            bottom: "-20px",
            margin: "0 auto"
        },
        '& p': {
            color: "#353535",
            maxWidth: "1100px",
            margin: "0 auto",
            fontSize: " 18px",
            fontWeight: "600",
            lineHeight: "26px"
        },
        '& h2': {
            color: "#212d3e",
            margin: "0 0 45px 0",
            fontWeight: "600",
            fontFamily: 'Jost',
            position: "relative",
            textAlign: "center"
        },
    },
    photo_sec_main_single: {
        position: "relative"
    },
    photo_sec_main_single_cont: {
        position: "relative",
        margin: "15px 0 0 0",
        textAlign: "center",
        '& h4': {
            position: "relative",
            fontFamily: 'Jost',
            fontSize: "30px",
            fontWeight: "600",
            color: "#000",
            margin: "0 0 20px 0"
        },
        '& p': {
            fontWeight: "600",
        },
    },
    photo_sec_main_single_img: {
        position: "relative",
        textAlign: "center",
        minHeight: "115px",
        '& ::after': {
            backgroundImage: "url(" + pic_bg + ")",
            backgroundSize: "cover",
            backgroundPosition: "center center",
            content: '""',
            height: "115px",
            width: "170px",
            position: "absolute",
            textAlign: "center",
            right: "0",
            left: "0",
            margin: "0 auto",
            top: "-100px",
            zIndex: "-1",
        },
    },
    our_partners_head: {
        position: "relative",
        textAlign: "center",
        '& h2::after': {
            backgroundImage: "url(" + ftr_head + ")",
            content: '""',
            height: "4px",
            width: "50px",
            position: "absolute",
            textAlign: "center",
            right: "0",
            left: "0",
            bottom: "-20px",
            margin: "0 auto"
        },
    },
}));
export default function LandingPage() {
    const classes = useStyles();
    const { dispatch } = useContext(AuthContext);
    const context = useContext(AuthContext);
    const [currentUser, setCurrentUser] = useState({});
    const [data, setData] = useState({});
    const [homeData, setHomeData] = useState({});
    const [siteTitle, setSiteTitle] = useState("");
    const [partnerData, setPartnerData] = useState([]);
    const [service, setService] = useState("serv1");
    const [openVideoModal, setOpenVideoModal] = useState(false);
    const [openVideoModalTwo, setOpenVideoModalTwo] = useState(false);
    const [maxWidth, setMaxWidth] = React.useState('md');
    const [currentBroker, setCurrentBroker] = useState({});
    const [emaildata, setEmailData] = useState("");
    const [openWarning, setOpenWarning] = useState(false);
    const [openError, setOpenError] = useState(false);
    const [openSuccess, setOpenSuccess] = useState(false);
    const [message, setMessage] = useState("");
    const [open, setOpen] = useState(false);

    useEffect(() => {
        window.scroll(0, 0);
        const obj = { authenticate_key: "abcd123XYZ" };
        postRecord(APIGetSiteSetting, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setData(res.data[0].response.data);
                    setSiteTitle(res.data[0].response.data.site_title)
                }
            });
    }, []);
    useEffect(() => {
        const obj = { authenticate_key: "abcd123XYZ" };
        postRecord(APIHomeData, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setHomeData(res.data[0].response.data);
                }
            });
    }, []);
    useEffect(() => {
        const obj = { authenticate_key: "abcd123XYZ" };
        postRecord(APIPartnerData, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setPartnerData(res.data[0].response.dataDetails.dataProvider);
                }
            });
    }, []);
    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
            postRecord(APIGetUserData, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setCurrentUser(res.data[0].response.data.agent_profile);
                    }
                });
        }
    }, [context.state.user]);
    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpenWarning(false);
        setOpenError(false);
        setOpenSuccess(false);
        setOpenVideoModal(false);
    };
    const handleLogout = () => {
        dispatch({
            type: "LOGOUT"
        });
    };

    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", broker_id: JSON.parse(context.state.user).user_id };
            postRecord(APIGetBrokerDetails, objusr)
                .then(res => {
                    setCurrentBroker(res.data[0].response.data.broker_profile);
                })
        }
    }, [context.state.user])
    // useEffect(() => {
    //     if (context.state.user) {
    //         const objusr = { authenticate_key: "abcd123XYZ", broker_id: JSON.parse(context.state.user).role };

    //     }
    // }, [context.state.user])

    const handleScroll = () => {
        window.scrollTo(0, 0);
    };
    const handleInputChange = (event) => {
        setEmailData(event.target.value);
    }
    const EmailFunctionality = () => {
        setOpen(true);
        const objusr = { authenticate_key: "abcd123XYZ", email_id: emaildata }
        postRecord(APIVisitorOption, objusr)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setOpen(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setOpen(true);
                }
            })
    }
    const opanWebsiteLink = (link) => {
        window.open(link, "_blank");
    }
    const openBox = () => {
        if (!$("#mob_btn").hasClass('active')) {
            $("#mob_btn").addClass('active');
            $("#mobilemenu").addClass('active');
            return $('body').css('overflow', 'hidden');
        } else {
            $("#mob_btn").removeClass('active');
            $("#mobilemenu").removeClass('active');
            return $('body').css('overflow', 'auto');
        }
    }
    return (
        <div>
            <section class="home_page">
                <div class="mobile_on mobile_slide">
                    <div class="mob_head">
                        <div class="hm_logo">
                            <a href="#">
                                <img src={logo} alt="Logo" title="Logo" />
                            </a>
                        </div>
                        <div id="mobilemenu">
                            <div class="mobilemenu-wrapper">
                                <div class="mobilemenu-trigger">
                                    <button id="mob_btn" class="trigger" onClick={openBox}>
                                        <span class="box">
                                            <span class="bar top"></span>
                                            <span class="bar middle"></span>
                                            <span class="bar bottom"></span>
                                        </span>
                                    </button>
                                </div>
                                <div class="mobilemenu-view">
                                    <div class="menu">
                                        <ul>
                                            <li>
                                                <Link to={APIPath() + "login"}>Login</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "agent"}>Register</Link>
                                            </li>
                                            <li class="">
                                                <Link to={APIPath()}>Home</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "features"}>Features</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "agent"}>Agents</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "broker"}>Brokers</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "association"}>Associations</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "preferred-vendors"}>Preferred Vendors</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "about-us"}>About</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "example"}>Example</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "pricing"}>Pricing</Link>
                                            </li>
                                            <li>
                                                <Link to={APIPath() + "faq"}>FAQ</Link>
                                            </li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <hr class="spacer1px"></hr>
                <div>
                    <OwlCarousel margin={10} {...options} id="home_slide">
                        <div class="home_page_banner">
                            <img src="https://www.virtualtourcafe.com/alpha/static/media/hm-banner-new-3.3929ad35.webp" alt="" title="" />
                            <div class="home_page_banner_cont mobile_on">
                                <div>
                                    <h1>THE PREMIER RESOURCE FOR REAL ESTATE PROFESSIONALS</h1>
                                    <h4>VirtualTourCafe, Your One Stop Solution for all your Real Estate Marketing Needs.</h4>
                                </div>
                            </div>
                        </div>
                        <div class="home_page_banner">
                            <img src="https://www.virtualtourcafe.com/alpha/static/media/hm-banner-new-1.5ea1d5b3.webp" alt="" title="" />
                            <div class="home_page_banner_cont mobile_on">
                                <div>
                                    <h1>THE PREMIER RESOURCE FOR REAL ESTATE PROFESSIONALS</h1>
                                    <h4>VirtualTourCafe, Your One Stop Solution for all your Real Estate Marketing Needs.</h4>
                                </div>
                            </div>
                        </div>
                        <div class="home_page_banner">
                            <img src="https://www.virtualtourcafe.com/alpha/static/media/hm-banner-new-2.bdfcc160.webp" alt="" title="" />
                            <div class="home_page_banner_cont mobile_on">
                                <div>
                                    <h1>THE PREMIER RESOURCE FOR REAL ESTATE PROFESSIONALS</h1>
                                    <h4>VirtualTourCafe, Your One Stop Solution for all your Real Estate Marketing Needs.</h4>
                                </div>
                            </div>
